pragma solidity ^0.8.11;


contract TestContract{
    struct demo{
        string name;
        string message;
        address from;
    }

    demo[] entry;
    address payable owner;
    constructor() payable {
        owner=payable(msg.sender);
    }

    function uploadTask(string memory name,string memory message) public payable{
        require(msg.value>0,"Please Pay greater than 0");
        // address payable selfAdd=payabl
        // address(this).transfer(msg.value);
        entry.push(demo(name,message,msg.sender));
    }

    function taskComplete(address receiver,uint amount)public payable{

       payable(receiver).transfer(amount*(1 ether)); 

    }

    function getTransact()public view returns(demo[] memory){
        return entry;
    }


    function getBalanceR(address receiver) public view returns (uint) {
        return receiver.balance;
    }
    function getBalanceS(address sender) public view returns(uint){
        return sender.balance;
    }

    function getBalanceC() public view returns(uint){
        return address(this).balance;
    }

    function getSelfAddress() public view returns(address){
        return address(this);
    }

}
